import '../UI/CartDetails.css'
const CartDetail = (props) =>{
    const details = props.cartDetails;

    return (
        <div className='body'>
        <div className='cards'>
            <div className='imgBox'><img src={details.image}></img></div>
            <div className='details'>
<p>{details.title}</p>
<p>{details.description}</p>
<p>{details.rating}</p>

            </div>
            
        </div>
        </div>
    )

}
export default CartDetail;
